import { useParams } from 'react-router-dom'

function Contact(props) {

    let {idx} = useParams();
    let members = props.members;

    return (
        <div>
            <h4>샘플 페이지</h4>
            <h6>ID: { members[idx].id }</h6>
            <h6>Name: { members[idx].name }</h6>
            <h6>부서: { members[idx].department }</h6>
            <h6>생일: { members[idx].birthday }</h6>
            <br />
        </div>

    )
}

export default SamplePage;
